import { Container, Row, Col } from "react-bootstrap";
import { BrowserRouter, Routes, Route, Link , useParams } from "react-router-dom";
import FilmsContainer from "./FilmsContainer"
import axios from "axios";
import cassete from './casette.png';

const Search = () => {
  const [inf, setInf] = useState(-1);

  useEffect(() => {
    axios.get("http://localhost:8080/api/film/ranking/" + inf)
    .then(res => {
        console.log(res.data)
        setList(res.data)
        })
    .catch(err => {
        console.log(err)
    })
}, [setList, inf]);

  return (
      <Container>
        <h1 style={{textAlign: "center", margin: "2pc"}}> Search films </h1>
        <button onClick={setInf(1)}/>
        <FilmsContainer data={inf}/>
      </Container>
    )
}

export default Search;
